import "./GoalItem.css";
function GoalItem(props){
    const deleteGoalHandler = (event)=>{
        props.onDelete(props.id);
    }
    return(
        <div className="goal-item__goal" onClick={deleteGoalHandler}>
            <p>{props.children}</p>
        </div>
    );
}
export default GoalItem;
